/*
 * README
 * 
 * Author: Larisa Cof
 * Date: 2020-09-27
 * 
 * Assignment:
 * Write a program that shows how evenly 
 * the built-in hashcode() function for 
 * strings in Java distributes the hashcodes 
 * for the words found in the text. (Hint it 
 * may be hard to use the hashcodes directly...)
 */

package lab3;
import java.util.*;
import java.io.*;

public class LAB3A3 {

	static int arraysize = 10000;
	static int total;
	static int collision = 0;
	static int q1, q2, q3, q4;

	public static void main(String[] args) throws FileNotFoundException {

		File file = new File("Inputtext.txt");
		Scanner sc = new Scanner(file);
		Hashtable<Integer, String> h = new Hashtable<Integer, String>();

		while (sc.hasNext() && h.size() < arraysize) {
			String word = sc.next();
			int index = hash(h); // Get array index instead of 32-bit integer

			while (h.containsKey(index)) // Om det vi vill lägga in har en key('index') som redan finns i h, gå in i
											// loopen
			{
				if (index == arraysize - 1) // Reset
					index = 0;

				index++;
				collision++;
			}

			if (h.contains(word) == false && h.size() != arraysize) // Kör ifall 'word' INTE finns i h
			{
				h.put(index, word); // Lägg in ordet, med det uträknade indexet från metoden hash ovan "index = key"
									// "word = value"
				quarter(index); // Fördela index
			}

		}
		printHash(h); // Kör denna efter whileloopen för texten är klar för att visa hashen
		sc.close();
	}

	private static void printHash(Hashtable<Integer, String> h) {
		System.out.print("\n" + h + "\n" + "Number of collisions: " + collision + "\nQ1: " + q1 + "\nQ2: " + q2
				+ "\nQ3: " + q3 + "\nQ4: " + q4);
	}

	private static void quarter(int index) // Ett sätt att se hur fördelningen av element ser ut
	{
		if (index <= arraysize / 4) // index 0-arraysize/4
			q1++;

		if (index > arraysize / 4 && index <= arraysize / 2) // index arraysize/4 - arraysize/2
			q2++;

		if (index > arraysize / 2 && index <= arraysize * 0.75) // index arraysize/2 - arraysize * 3/4
			q3++;

		if (index > arraysize * 0.75) // index arraysize 3/4 - end (4/4)
			q4++;
	}
	
	// Converting a hashCode() to an array index. 
	// Since our goal is an array index, not a 32-bit integer, 
	// we combine hashCode() with modular hashing in our 
	// implementations to produce integers between 0 and arraysize-1 as follows:

	private static Integer hash(Hashtable<Integer, String> h) {
		return ((h.hashCode() & 0x7fffffff) % arraysize);
	}
}

